import React, { Component } from 'react';
import 'assets/css/estilos.css';

const CADASTRO_USUARIO = {
    type: 'CADASTRO_USUARIO',
    nome,
    sobrenome,
    email,
    telefone,
    endereco,
    senha,
}

export class CadastroView extends Component {
    render() {
        return (
            <div>
                <header>
                    <p>Teste</p>
                </header>
            </div>
        );
    }
}
